import AppBar from "./components/appBar";
import "./styles.css";
import AppRouter from "./appRouter/appRouter";
export default function App() {
  const whichPage =(e,data)=>{
    e.preventDefault();
    console.log(data);
    if(data.page==="Cart"){
      return <AppRouter />;
    }

  }
  return (
    <div className="App">
      <AppBar whichPage ={whichPage}/>
      <AppRouter />
    </div>
  );
}
